@thatsvexing wordlessly, the girl turned to begin pulling shots on the machine beside her.

     “ took you long enough! “ she throws a wink his way. “ how’re you? how’s work? “

a ( hefty ) amount of caramel is drizzled around the inside of the cup before syrup, shots, and milk are added.

@thatsvexing “ MAE*! “ his gruff voice sounded in her direction. she could hardly shoot back ‘ it’s ( maeve ) ‘ before the excitement of seeing the familiar face bubbled up from the pit of her stomach. 

“ HEY YOU! “ 

a beaming smile.

